import datetime
import json
import time
import websocket
import pandas as pd
import os 

WS_URL = "ws://localhost:8765"

ws = websocket.create_connection(WS_URL, header={"UID": "test"})
TIMEOUT = 2
# Wait for ws to connect
time.sleep(1)

columns = ["test", "succeeded", "time", "result", "round", "current_time"]

csv_data = pd.read_csv("./Testing/output.csv")

class ws_tester:

    def __init__(self, clear_after_test=True) -> None:
        self.tests = []
        self.clear_after_test = clear_after_test
    
    def run_test(self, type, iterations = 5, validation_function=None, timeout=1, number_of_expected_results=1, name=None, clear_after_round=True,include_results_as_seperate_tests=True, only_show_types_in_data = False, **kwargs):
        global csv_data
        global ws
        
        for i in range(iterations):
            t0 = time.perf_counter_ns()
            
            code = {
                "type": type,
                **kwargs
            }
            
            ws.send(json.dumps(code))
            
            # Set a timeout of 1 second for the recv operation
            ws.settimeout(timeout)
            
            try:
                received_data = ""
                
                if number_of_expected_results == -1:
                    j = 0
                    while True:
                        print(timeout)
                        ws.settimeout(timeout)

                        try:
                            data = ws.recv()
                            
                            received_data += json.loads(data).get("type")+ " " if only_show_types_in_data else data[0:100]
                        except websocket.WebSocketTimeoutException as e:
                            break

                        if include_results_as_seperate_tests:
                            print(f"Received data: {received_data}")

                            t1 = time.perf_counter_ns()
                            if validation_function:
                                succeeded = validation_function(received_data)
                            else:
                                succeeded = True
                            new_row = {"test": name or type, "succeeded": succeeded, "time": (t1 - t0)* 0.000001, "result": received_data, "round": (i*10)+j, "current_time": time.time()}
                            csv_data = pd.concat([csv_data, pd.DataFrame([new_row])])
                            print((t1 - t0) * 0.000001)
                    
                        j += 1
                
                for j in range(number_of_expected_results):
                    data = ws.recv()

                    received_data += json.loads(data).get("type") + " " if only_show_types_in_data else data[0:100]

                    if include_results_as_seperate_tests:
                        print(f"Received data: {received_data}")

                        t1 = time.perf_counter_ns()
                        if validation_function:
                            succeeded = validation_function(received_data)
                        else:
                            succeeded = True
                        new_row = {"test": name or type, "succeeded": succeeded, "time": (t1 - t0)* 0.000001, "result": received_data, "round": (i*10)+j, "current_time": time.time()}
                        csv_data = pd.concat([csv_data, pd.DataFrame([new_row])])
                        print((t1 - t0) * 0.000001)

                
                t1 = time.perf_counter_ns()
                
                if validation_function:
                    succeeded = validation_function(received_data)
                else:
                    succeeded = True

            except websocket.WebSocketTimeoutException:
                print("Timeout occurred while waiting for data.")
                new_row = {"test": name or type, "succeeded": False, "time": timeout , "result": "Timedout", "round": i, "current_time": time.time()}

                # Use concat to add the new row
                csv_data = pd.concat([csv_data, pd.DataFrame([new_row])])
                if clear_after_round:
                    self.clear_recv()
                continue
            
            if include_results_as_seperate_tests:
                if clear_after_round:
                    self.clear_recv()
                continue
            
            print(f"Received data: {received_data}")

            new_row = {"test": name or type, "succeeded": succeeded, "time": (t1 - t0)* 0.000001, "result": received_data, "round": i, "current_time": time.time()}
            
            csv_data = pd.concat([csv_data, pd.DataFrame([new_row])])
            
            print((t1 - t0) * 0.000001)

            if clear_after_round:
                self.clear_recv()
                

    def add_test(self, type: str, iterations = 5, validation_function=None, timeout=1, name :str=None, number_of_expected_results=1, clear_after_round=True, include_results_as_seperate_tests=True, only_show_types_in_data = False, **kwargs):
        def test_builder():
            def test():
                self.run_test(type=type, iterations=iterations, validation_function=validation_function, timeout=timeout, name=name, number_of_expected_results=number_of_expected_results, clear_after_round=clear_after_round, include_results_as_seperate_tests=include_results_as_seperate_tests, only_show_types_in_data=only_show_types_in_data, **kwargs)
            return test
        self.tests.append(test_builder())
    
    def clear_recv(self):
        ws.settimeout(TIMEOUT)

        while True:
            try:
                ws.recv()
            except websocket.WebSocketTimeoutException:
                break
            
        ws.settimeout(5)
    
    def run_tests(self):
        for test in self.tests:
            test()
            
            if self.clear_after_test:
                self.clear_recv()
            
        # Save to CSV without the index column
        csv_data.to_csv(f"Testing/output.csv", index=False, columns=columns)


tester = ws_tester()

audio_data = ""

tester.add_test("handle_audio", number_of_expected_results=10, audio_data=audio_data, sample_rate= 44100, sample_width=2, iterations=10, timeout=20, only_show_types_in_data=True)

tester.run_tests()
    
